import { useEffect } from "react";

const BearContainer = (props) => {

  return (
    <div onClick={() => props.toggleActiveDowner(props.data.id)} style={props.openApp ? {borderRight: 'transparent'} : {borderRight : '1px solid red'}} className={props.data.active ? "active-down-symbol downer symbol-box" : "downer symbol-box"}>
      <h2 id="symbol">{props.data.name}</h2>
      <p className="price">Price: ${props.data.price}</p>
      <div className="changes-row">
        <p className="">{props.data.percentage}%</p>
        <img id="downArrow" src="./images/downArrow.svg"/>
        <p>${props.data.change}</p>
      </div>
    </div>
  );
};

export default BearContainer;
